import React, { Component } from "react";
import List from "./ListGropup_mid";
const Card = ({ card_details }) => {
  return (
    <div class="card m-1">
      <img
        class="card-img-top img-thumbnail"
        src={card_details.links.mission_patch_small}
        alt="Card image cap"
      ></img>
      <div class="card-body">
        <h5 class="card-title text-primary">{`${card_details.mission_name}#${year.flight_number}`}</h5>
        <List mission_ids={card_details.mission_ids} />

        <a href="#" class="btn btn-primary">
          Go somewhere
        </a>
      </div>
    </div>
  );
};

export default Card;
